import { render } from '@testing-library/react';
import React, {Component} from 'react';
import './Hello.css'

class Hello extends Component {
    render() {
        return(
            <div className = "f1 tc">
                <h1> Hello World </h1>
                <h2>Hi Ganesh </h2>
            </div>
        )
    }
}

export default Hello;
